import React from 'react';

const Signup = () => {

    return(
        <div>
             <h1 text="bold" className="sign">Sign Up</h1>
             <form>
                 <p>Full Name</p>
                 <input/>
                 <h2>Email</h2>
                 <input/>
                 <h2>Password</h2>
                 <input/>
                 <h2>Confirm Password</h2>
                 <input/>
             </form>
        </div>
    )
}

export default Signup;
